import React from 'react';
import './Experiences.scss';

interface Image {
  src: string;
  alt: string;
  projectName: string;
  companyName: string;
}

interface ExperiencesProps {
  images: Image[];
}

const Experiences: React.FC<ExperiencesProps> = ({ images }) => {
  return (
    <div className="experiences">
      {images.map((image, index) => (
        <div key={index} className="experience-item">
          <img src={image.src} alt={image.alt} className="experience-image"/>
          <div className="text-overlay">
            <div className="project-name" data-text={image.projectName}>{image.projectName}</div>
            <div className="company-name">{image.companyName}</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Experiences;
